import React from "react";

function Login() {
    return (
        <div>
            Login
            <div>
            <button className="btn">Button</button>
            <button className="btn w-64 rounded-full">버튼</button>
            <button className="btn btn-wide">버튼</button>
        </div>
        </div>
    );
}

export default Login;
